import * as React from 'react';
import "../css/contact.css";
import NavBar from '../dynamic/NavBar';

function contactDetail(props){
    let icon = props.icon;
    let text = props.text;

    return(
        <div id="detailContainer">
            {/* <div id="detailIcon" style={{background:'url('icon')'}}></div> */}
            <div id="detailText"></div>
        </div>
    );
}

function Contact(){
return(
    <div id='contactContainer'>
        <NavBar/>
        <div id='contentContainer'>
            
           <div id = "mapContainer">
           <div className="google-map-code">
           <iframe id = 'mapContainer' src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15282225.79979123!2d73.7250245393691!3d20.750301298393563!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x30635ff06b92b791%3A0xd78c4fa1854213a6!2sIndia!5e0!3m2!1sen!2sin!4v1587818542745!5m2!1sen!2sin"  frameborder="0" style={{border:0}} allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
        </div>
           </div>
           <div id="contactDetails">
            <contactDetail text = {"Str.E.A.Bielz Nr.60 Sibiu"}/>
           </div>
        </div>
    </div>
);
}

export default Contact;
